import React, { Component } from 'react';

import './body.css';
import './add.css';

class Password extends Component {
    render() {
        return (
            <div>
                <form method="POST" action="/">
                    <input type="text" name="name"/>
                    <br/>
                    <input type="submit" value="Add"/>
                </form>
            </div>
        );
    }

}

export default Password;
